  `grade` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS house_master_report;

CREATE TABLE `house_master_report` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `con` varchar(5000) NOT NULL,
  `grade` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS indexno;

CREATE TABLE `indexno` (
