  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS receiptno;

CREATE TABLE `receiptno` (
  `id` int(11) NOT NULL,
