DROP TABLE IF EXISTS tbl_assesments;

CREATE TABLE `tbl_assesments` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `courseId` varchar(20) NOT NULL,
  `stuId` varchar(200) NOT NULL,
  `test1` double NOT NULL,
  `test2` double NOT NULL,
  `test3` double NOT NULL,
  `test4` double NOT NULL,
  `exam` double NOT NULL,
