  UNIQUE KEY `class` (`class`,`student`,`year`,`term`)
) ENGINE=InnoDB AUTO_INCREMENT=223 DEFAULT CHARSET=latin1 COMMENT='CREATES A CLASS FOR STUDENTS';




DROP TABLE IF EXISTS tbl_classes;

CREATE TABLE `tbl_classes` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
