  `PROGRAMMECODE` varchar(255) DEFAULT NULL,
  `LEVEL` int(11) NOT NULL,
  `STNO` varchar(255) DEFAULT NULL,
  `SURNAME` varchar(255) DEFAULT NULL,
  `NAME` varchar(255) DEFAULT NULL,
  `FIRSTNAME` varchar(255) DEFAULT NULL,
  `OTHERNAMES` varchar(100) NOT NULL,
  `SEX` varchar(255) DEFAULT NULL,
  `DATEOFBIRTH` varchar(255) DEFAULT NULL,
  `AGE` int(11) NOT NULL,
  `DATE_ADMITTED` varchar(255) DEFAULT NULL,
  `OPTIONS` varchar(255) DEFAULT NULL,
  `GRADUATING_GROUP` varchar(255) DEFAULT NULL,
  `FINANCE_TYPE` varchar(100) NOT NULL,
  `HALL` varchar(255) DEFAULT NULL,
  `ADDRESS` varchar(255) DEFAULT NULL,
  `RESIDENTIAL_ADDRESS` varchar(100) NOT NULL COMMENT 'resident address',
  `EMAIL` varchar(255) DEFAULT NULL,
  `TELEPHONENO` varchar(255) DEFAULT NULL,
  `SSN` varchar(255) DEFAULT NULL,
  `ADMISSIONTYPE` varchar(255) DEFAULT NULL,
  `COUNTRY` varchar(255) DEFAULT NULL,
  `REGION` varchar(255) DEFAULT NULL,
  `RELIGION` varchar(100) NOT NULL,
  `HOMETOWN` varchar(100) NOT NULL,
  `GUARDIAN_NAME` varchar(100) NOT NULL,
  `GUARDIAN_ADDRESS` varchar(100) NOT NULL,
  `GUARDIAN_PHONE` varchar(10) NOT NULL,
